import { FormsModule } from '@angular/forms';
//import { ErrorComponent } from './error/error.component';

@NgModule({
  declarations: [
    AppComponent
    // Agregado Routing

  ],
  imports: [
    BrowserModule,
    // Agregado
    //CancionesModule,
    EventosModule,
    HttpClientModule,
    //Agragado Routing
    RouterModule,
    LoginComponent
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
